import styled from 'styled-components';

export default styled.div`
	display: flex;
	flex-direction: column;
	align-items: center;
    justify-content: center;
	background-color: rgba(20,20,20,0.5);
	height: 300px; width: 300px;
	border: 1px solid black;
	text-align: center;
	color: #E2E2E2;
	margin-left: auto;
	margin-right: auto;


	p {
		padding: 20px;
	}
`;
